import React from 'react';
import Head from 'next/head';

import styled from 'styled-components';

import '../css/artist.css';
import '../css/normalize.css';
import '../css/skeleton.css';

class Auditory extends React.Component{

	render(){

		return(
			<div className='artistArea'>
				<div className='artistBackground'>
					<img src={this.props.artist.display_src} alt={this.props.artist.name} className='artistMainPhoto' />	    <iframe className='artistVideo' src={this.props.artist.mv} frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
					<div className='bio'>
					{this.props.artist.bio}
					</div>
				</div>
			</div>
		)
	}
}

export default Auditory;
